كل ما عم بنتعمق بالتخصص ، كل ما الواحد بيتعجب بِعظمة خلق الله لجسم الانسان بأدق تفاصيله ..
وقتها الواحد فعلًا بيستشعر معنى الآية {وَفِي أَنفُسِكُمْ ۚ أَفَلَا تُبْصِرُونَ} 
سبحانك يا رب 🙏🏻💕

{وَوَصَّيْنَا الْإِنسَانَ بِوَالِدَيْهِ حَمَلَتْهُ أُمُّهُ وَهْنًا عَلَىٰ وَهْنٍ  .. } 

كل ما تمرق علي هاي الآية بدعي ربنا اذا شي يوم صرت ام اكون ام عظيمة متل ماما 🍃
كمية الشغلات يلي ضحت و عّم بتضحي فيها عشانا كبيرة كتير..
